import React, { Component } from 'react'
import './index.css';

export class Login extends Component {
    render() {
        return (
            <div>
                <form action="#">
                    <div className="form-group mb-3">
                        <input type="text" className="form-control" placeholder="First Name"/>
                    </div>
                </form>
            </div>
        )
    }
}

export default Login
